var jsonData = msg.payload;
var html = '';

jsonData.forEach(function (bus) {
    html += `<div class="row">
                <div class="col-xs-12">
                    <div class="panel panel-default">
                        <div class="panel-heading"><strong>Bus ${bus.Bus} - ${bus["Bus direction"]}</strong></div>
                        <div class="panel-body">
                            <p><strong>Bus Stop:</strong> ${bus["Bus Stop"]}</p>
                            <p><strong>Next Bus:</strong> ${bus["Next Bus"]}</p>
                            <p><strong>Subsequent Bus:</strong> ${bus["Subsequent Bus"]}</p>
                            <p>====================================</p>
                        </div>
                    </div>
                </div>
            </div>`;
});

msg.payload = html;
return msg;
